ME is a self-sovereign identity protocol developed by AstroX Network. ME provides the following features:
 1. Sign in with human-readable username, from multiple devices across desktop/mobile platforms;
2. Authorize with Ethereum wallet, such as MetaMask or any WalletConnect compatible wallet;
3. Authorize with biometric device, such as Face ID and fingerprint;
4. Manage multiple Internet Identities, linked with NNS wallets from the Dfinity Foundation, and ICP can be sent and received within ME;
5. Support DApps login with user’s  Internet Identity or wallet, without installing any browser plug-in, either on desktop or mobile.
